import React, { useEffect, useState } from "react";
import cartService from "../services/cartService";
import productService from "../services/productService";
import { useNavigate } from "react-router-dom";
import "./Cart.css";

const Cart = ({ username }) => {
  const [cartItems, setCartItems] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [subtotal, setSubtotal] = useState(0);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchCart = async () => {
      try {
        const response = await cartService.getCart(username);
        if (response.length > 0 && response[0].cart.items) {
          setCartItems(response[0].cart.items);
          setSubtotal(response[0].subtotal);
        } else {
          setCartItems([]);
        }
      } catch (err) {
        console.error("Error fetching cart:", err);
        setCartItems([]);
      } finally {
        setLoading(false);
      }
    };

    fetchCart();
  }, [username]);

  const handleBuyNow = () => {
    navigate("/checkout", { state: { cartItems } });
  };

  if (loading) return <p>Loading cart...</p>;
  if (cartItems.length === 0) return <p>Your cart is empty.</p>;

  return (
    <div className="cart-page">
      <div className="cart-container">
        {/* Shopping Cart Section */}
        <div className="cart-items">
          <header className="cart-header">
            <h1>Your Shopping Cart</h1>
            <span>{cartItems.length} Items</span>
          </header>
          {cartItems.map((item) => (
            <div className="cart-item" key={item._id}>
              <img
                src={
                  item.productId.productImage ||
                  "https://via.placeholder.com/80"
                }
                alt={item.productId.productName}
              />
              <div className="item-details">
                <h3>{item.productId.productName}</h3>
                <p>Ref. {item.productId.productID}</p>
                <p>${item.productId.productPrice?.toFixed(2)}</p>
              </div>
              <div className="item-quantity">
                <span>Qty: {item.quantity}</span>
              </div>
              <div className="item-total">
                ${(item.quantity * item.productId.productPrice).toFixed(2)}
              </div>
            </div>
          ))}
          <a href="/" className="back-to-shop">
            ‚Üê Back to Shop
          </a>
        </div>

        {/* Order Summary Section */}
        <div className="order-summary">
          <h2>Order Summary</h2>
          <div className="summary-details">
            <p>
              <span>Items:</span>
              <span>{cartItems.length}</span>
            </p>
            <p>
              <span>Subtotal:</span>
              <span>${subtotal.toFixed(2)}</span>
            </p>
            <p>
              <span>Shipping:</span>
              <span>Free</span>
            </p>
            <button className="checkout-button" onClick={handleBuyNow}>
              Checkout
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Cart;
